import React, { Component } from "react";

const Guest = (props) => {
  console.log(props);
  return (
    <tr>
      <td>Alex</td>
      <td>9949959495</td>
    </tr>
  );
};

class GuestList extends Component {
  state = {
    guestUsersList: [
      {
        name: "Alex",
        number: 678900123,
      },
    ],
  };
  render() {
    return (
      <div classNmae="GuestList">
        <div className="Guest">
          <table>
            <tr>
              <th>Name</th>
              <th>Number</th>
            </tr>
            {this.state.guestUsersList.map((user) => {
              return <Guest user={user} key={Date.now()} />;
            })}
            <Guest />
          </table>
        </div>
      </div>
    );
  }
}

export default GuestList;
